**Access Flow/Action data using the fd_data object. Script must return a value.
**example: var shortDesc = fd_data.trigger.current.short_description;
**return shortDesc;
*/

var path = "/zipcode/distance?X-API-KEY=" + fd_data.action_inputs.key +"&zip1="+ fd_data.action_inputs.zip1 +"&zip2=" + fd_data.action_inputs.zip2;
return path;"}}

sys_variable_value.value:
(function execute(inputs, outputs) {
// ... code ...
  if(inputs.status == "200"){
  	var resp = inputs.response;
    var parsed = JSON.parse(resp);
    var dist = parsed["data"];
    var parsedItem = JSON.parse(JSON.stringify(dist));
    var avail = new GlideRecord('x_598934_find_hosp_distance_between_2_points');

    if(avail.hasNext()){
      avail.next();
      avail.distance = parsedItem.distance;
      avail.zip1 = inputs.zip1;
      avail.zip2 = inputs.zip2;
      avail.update();

    } else {
      avail.initialize();
      avail.distance = parsedItem.distance;
 	  avail.zip1 = inputs.zip1;
      avail.zip2 = inputs.zip2;
      avail.insert();

    }
  } 

})(inputs, outputs);

